            <h1>Oscar</h1>
            <p>Hej! Jag spelar musik, mestadels i Värmland.</p>
            <p>Boka mig, skriv på <a href="https://www.facebook.com/oscar.andersson.7503/">Facebook</a> eller med ett <a href="https://t.me/oscar230">Telegram</a>.</p>
            <p>Följ mig på Instagram, gå in på <a href="https://www.instagram.com/oscar_erik_andersson/">@oscar_erik_andersson</a>.</p>
            <p>Nedan kan du lyssna på några av mina mixar.</p>
